import AdminPage from './component/adminpage'
import './App.css';
import { useEffect, useState } from 'react';

function App() {
  const [coinsArr, setcoinsArr] = useState([]);

  useEffect(() => {
    fetch("https://coinscore-cc-backend.onrender.com/api/collections/getcoins")
    .then((res) => res.json())
    .then(data => data.data)
    .catch(err => console.log(err))

    setcoinsArr(data);
    console.log()
  }, [])

  return (
    <div className="App">
     <AdminPage />
    </div>
  );
}

export default App;
